import React from 'react'
import { withStyles } from "@material-ui/styles"

const styles = {
  heroImageContainer: {
    width: "100%",
    height: "64vh",
    background: "grey",
    overflow:"hidden",
    width:"100%"
  },
  heroImage:{
    width:"100%"
  }
};

function ProjectHeroImage(props) {

  const { classes, heroImage } = props;
  return (
    <div className={classes.heroImageContainer}>
      <img className={classes.heroImage} src={heroImage} />
    </div>
  )

}

export default withStyles(styles)(ProjectHeroImage);
